import logo from './logo.svg';
import React from 'react';
import Header from './Header';
import Sidebar from './Sidebar.js';
import MainContent from './MainContent';
import Footer from './Footer';

function App() {
  return (
    <div>
      <Header />
      <div style={{ display: 'flex' }}>
        <Sidebar />
        <MainContent />
      </div>
      <Footer />
    </div>
  );
}
export default App;
